// SPDX-License-Identifier: MIT

pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/utils/Base64.sol";

import "./ISoul.sol";
import "../IDDS.sol";
import "./IsoulBondToken.sol";
import "../IDateTime.sol";

contract soulBondToken is ERC721Enumerable {
    struct tokenStructure {
        string issuer;
        string certification;
        uint256 claimDate;
        uint256 validDate;
    }

    using Strings for uint256;
    using Strings for uint160;

    mapping(uint256 => uint256[]) private soul2Token;
    mapping(uint256 => uint256) private token2Soul;
    mapping(uint256 => tokenStructure) private token2Value;

    mapping(bytes32 => bool) private globalAllow;
    mapping(bytes32 => uint256) private validDate;
    mapping(address => mapping(bytes32 => bool)) private allowMap;

    IDDS dds;

    constructor() ERC721("SoulBontToken Registry", "SBT") {
        dds = IDDS(BEE_DDS_ADDRESS);
    }

    function issue(
        string calldata _issuer,
        string calldata _certification,
        uint256 validDate_,
        address[] memory _allows
    ) external {
        require(dds.getOwner(_issuer) == msg.sender, "Only domain owner");
        // require(
        //     dds.get(_issuer, _certification).length > 0,
        //     "DDS data not found"
        // );

        bytes32 _hash = keccak256(abi.encodePacked(_issuer, _certification));

        validDate[_hash] = validDate_;

        if (_allows.length == 0) globalAllow[_hash] = true;
        else {
            for (uint256 i = 0; i < _allows.length; i++) {
                allowMap[_allows[i]][_hash] = true;
            }
        }
    }

    function claim(
        uint256 _soulId,
        string calldata _issuer,
        string calldata _certification
    ) external {
        ISoul soul = ISoul(
            dds.toAddress(dds.get("ISOTOP", "BEE_SOUL_ADDRESS"))
        );
        require(soul.validateAddress(_soulId, msg.sender), "not owner");
        _claim(msg.sender, _soulId, _issuer, _certification);
    }

    function assign(
        address _to,
        uint256 _soulId,
        string calldata _issuer,
        string calldata _certification
    ) external {
        ISoul soul = ISoul(
            dds.toAddress(dds.get("ISOTOP", "BEE_SOUL_ADDRESS"))
        );
        require(msg.sender == soul.getOperator(_soulId), "only operator");
        _claim(_to, _soulId, _issuer, _certification);
    }

    function _claim(
        address _to,
        uint256 _soulId,
        string calldata _issuer,
        string calldata _certification
    ) internal {
        bytes32 _hash = keccak256(abi.encodePacked(_issuer, _certification));

        require(
            globalAllow[_hash] || allowMap[_to][_hash],
            "Address not in allow list"
        );

        uint256 _currentId = totalSupply();
        token2Soul[_currentId] = _soulId;
        token2Value[_currentId] = tokenStructure(
            _issuer,
            _certification,
            block.timestamp,
            validDate[_hash]
        );
        soul2Token[_soulId].push(_currentId);
        _mint(_to, _currentId);

        allowMap[_to][_hash] = false;
    }

    function getToken(uint256 tokenId)
        external
        view
        returns (tokenStructure memory)
    {
        // require(
        //     soul.validateAddress(token2Soul[tokenId], msg.sender),
        //     "not owner"
        // );
        return token2Value[tokenId];
    }

    function getTokenIds(uint256 soulId)
        external
        view
        returns (uint256[] memory)
    {
        // require(soul.validateAddress(soulId, msg.sender), "not owner");
        return soul2Token[soulId];
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    ) internal virtual override {
        if (to == address(0)) {
            revert("SBT token cannot be burned");
        }

        ISoul soul = ISoul(
            dds.toAddress(dds.get("ISOTOP", "BEE_SOUL_ADDRESS"))
        );

        if (from == address(0)) {
            require(
                soul.validateAddress(token2Soul[tokenId], to),
                "SBT token to address not allowed"
            );
        } else {
            require(
                soul.validateAddress(token2Soul[tokenId], from) &&
                    soul.validateAddress(token2Soul[tokenId], to),
                "SBT token cannot transfered"
            );
        }

        super._beforeTokenTransfer(from, to, tokenId);
    }

    function tokenURI(uint256 tokenId)
        public
        view
        virtual
        override
        returns (string memory)
    {
        require(_exists(tokenId), "nonexistent token");

        IDateTime date = IDateTime(
            dds.toAddress(dds.get("ISOTOP", "BEE_DATETIME_ADDRESS"))
        );

        tokenStructure memory _value = token2Value[tokenId];
        bytes memory tokenData = dds.get(_value.issuer, _value.certification);
        bytes memory image_;

        if (tokenData.length < 1) image_ = dds.get("ISOTOP", "BEE_SBT_DEFAULT");
        else {
            if (
                tokenData[0] == 0x68 /* h means http://URL */
            )
                return
                    string(
                        abi.encodePacked(tokenData, tokenId.toString(), ".json")
                    );

            if (
                tokenData[0] == 0x3c /* <svg... means image */
            ) image_ = tokenData;
            else image_ = dds.get("ISOTOP", "BEE_SBT_DEFAULT");
        }

        bool isValid = _value.validDate > block.timestamp;
        dds.setValue(
            image_,
            "[SOULID         ]",
            bytes(token2Soul[tokenId].toString())
        );
        dds.setValue(image_, "[TOKENID        ]", bytes(tokenId.toString()));
        dds.setValue(
            image_,
            "[CLAIM DATE          ]",
            bytes(date.timeToDate(_value.claimDate))
        );
        dds.setValue(
            image_,
            "[VALID DATE          ]",
            bytes(date.timeToDate(_value.validDate))
        );
        dds.setValue(
            image_,
            "[IS VALID?]",
            bytes(isValid ? "VALID" : "NOT VALID")
        );

        bytes memory meta = abi.encodePacked(
            '{"name": "SBT#',
            tokenId.toString(),
            "|",
            _value.certification,
            '", "symbol": "SBT", "description": "SoulBoundToken property", "image":"data:image/svg+xml;base64,',
            Base64.encode(image_),
            '", "designer": "',
            _value.issuer,
            '", "attributes": [{ "trait_type": "Soul", "value": "'
        );
        meta = abi.encodePacked(
            meta,
            token2Soul[tokenId].toString(),
            '"},{ "trait_type": "SBT ID", "value": "',
            tokenId.toString(),
            '"},{ "trait_type": "Certificate Issuer", "value": "',
            _value.issuer,
            '"},{ "trait_type": "Claim Date", "value": "',
            date.timeToDate(_value.claimDate),
            '"},{ "trait_type": "Valid Date", "value": "',
            date.timeToDate(_value.validDate),
            '"},{ "trait_type": "Certification Valid", "value": "',
            isValid ? "VALID" : "NOT VALID",
            '"}]}'
        );

        return
            string(
                abi.encodePacked(
                    "data:application/json;base64,",
                    Base64.encode(meta)
                )
            );
    }
}
